            <div class="card-actions justify-end">
              <button class="btn btn-primary" (click)="setNewMeetDetail('class','new_meet_form')">Create <i
                  class="bi bi-plus-lg"></i></button>
            </div>
          </div>
        </div>
        <div class="card bg-base-100 image-full w-96 shadow-xl">
          <figure>
            <img src="assets/images/dashboard/office_cabin_meeting.jpeg" alt="office_cabin_meeting" />
          </figure>
          <div class="card-body">
            <h2 class="card-title">Office Cabin meet</h2>
            <p>If a dog chews shoes whose shoes does he choose?</p>
            <div class="card-actions justify-end">
              <button class="btn btn-primary" (click)="setNewMeetDetail('Office','new_meet_form')">Create <i
                  class="bi bi-plus-lg"></i></button>
            </div>
          </div>
        </div>

      </ng-container>
    </div>

    <ng-container *ngIf="meetType === 'new_meet_form'">
      <div class="flex justify-center w-100">
        <div class="card bg-white w-96 shadow-xl">
          <!-- <figure>
            <img src="assets/images/dashboard/conference.jpg" alt="Shoes" />
          </figure> -->
          <div class="flex justify-between">
            <a (click)="meetType = 'new_meet'" style="color: red; cursor: pointer; padding: 10px;">Back to meeting screen</a>

          </div>
          <div class="card-body">
            <h2 class="card-title">{{creatingMeetType | uppercase}} MEET</h2>
            <label class="input input-bordered flex items-center gap-2 position-relative">
              <strong>Code</strong>
              <input type="text" class="grow" placeholder="Daisy" readonly [value]="newMeetGeneratedCode" />
              <button class="btn btn-ghost" style="position: absolute; right: 0%; top: 0%;"
                (click)="copyCode_Clipboard()"><i class="bi bi-link-45deg"></i> <strong>{{isCopied ? 'Copied' :
                  'Copy'}}</strong></button>
            </label>
            <label class="form-control w-full max-w-xs w-100">
              <div class="label">
                <span class="label-text"><strong>Candidate Limit?</strong></span>
              </div>
              <input type="number" placeholder="Type here" class="input input-bordered w-full max-w-xs w-100"
                [(ngModel)]="newMeetDetail.MeetCandidateQuantity" />
            </label>
            <label class="form-control w-full max-w-xs w-100">
              <div class="label">
                <span class="label-text"><strong>Meeting Date?</strong></span>
              </div>
              <input type="datetime-local" placeholder="Type here" class="input input-bordered w-full max-w-xs w-100"
                [(ngModel)]="newMeetDetail.MeetDateTime" />

            </label>
            <div class="card-actions justify-end">
              <button class="btn btn-primary" (click)="createMeet()">Create <i class="bi bi-plus-lg"></i></button>
            </div>
          </div>
        </div>
      </div>
    </ng-container>

    <ng-container *ngIf="meetType === 'join_meet_form'">
      <div class="flex justify-center w-100">
        <div class="card bg-white w-96 shadow-xl">
          <!-- <figure>
            <img src="assets/images/dashboard/conference.jpg" alt="Shoes" />
          </figure> -->
          <div class="card-body text-center">
            <div class="flex flex-row justify-between">
              <button type="button" class="btn btn-sm btn-primary" (click)="meetType = ''">
                <strong>Back</strong>
              </button>
              <h2 class="card-title">{{joiningMeetType | uppercase}} MEET</h2>
            </div>

            <label class="form-control w-full max-w-xs w-100">
              <div class="label">
                <span class="label-text"><strong>First Name</strong></span>
              </div>
              <input type="text" placeholder="Type here" class="input input-bordered w-full max-w-xs w-100"
                [(ngModel)]="joiningUserDetail.FirstName" />
            </label>
            <label class="form-control w-full max-w-xs w-100">
              <div class="label">
                <span class="label-text"><strong>Last Name</strong></span>
              </div>
              <input type="text" placeholder="Type here" class="input input-bordered w-full max-w-xs w-100"
                [(ngModel)]="joiningUserDetail.LastName" [disabled]="!joiningUserDetail.FirstName" />
            </label>
            <label class="form-control w-full max-w-xs w-100"
              (keyup)="getUserActiveSessionDetail(userContactNoEle.value)">
              <div class="label">
                <span class="label-text"><strong>Contact Number</strong></span>
              </div>
              <input #userContactNoEle type="number" placeholder="Type here"
                class="input input-bordered w-full max-w-xs w-100" minlength="10" maxlength="10"
                [(ngModel)]="joiningUserDetail.ConatctNo" [disabled]="!joiningUserDetail.LastName" />
              <div class="label">
                <span class="label-text" style="color: red;"><strong><small>Make sure to enter correct contact
                      number.</small></strong></span>
              </div>
            </label>
            <label class="input input-bordered flex items-center gap-2 position-relative">
              <strong>Meet Code</strong>
              <input type="text" class="grow" placeholder="Enter meet code" [(ngModel)]="joiningUserDetail.MeetCode"
                [disabled]="userContactNoEle.value.length !== 10" />
              <div class="label" *ngIf="!isNewUserSession && userContactNoEle.value.length === 10">
                <span class="label-text" style="color: red;"><strong><small>You are already part of
                      meet.</small></strong></span>
              </div>
              <!-- <button class="btn btn-ghost" style="position: absolute; right: 0%; top: 0%;"
                (click)="copyCode_Clipboard()"><i class="bi bi-link-45deg"></i> <strong>{{isCopied ? 'Copied' :
                  'Copy'}}</strong></button> -->
            </label>
            <small
              *ngIf="!joiningUserDetail.FirstName && !joiningUserDetail.LastName && !joiningUserDetail.ConatctNo && !joiningUserDetail.MeetCode"
              style="color: red;"><i><strong>Please fill up entire details to start meet.</strong></i></small>
            <div class="card-actions justify-end">
              <button
                [disabled]="(!joiningUserDetail.FirstName || !joiningUserDetail.LastName || !joiningUserDetail.ConatctNo) && !joiningUserDetail.MeetCode.length && !isNewUserSession"
                class="btn btn-primary" (click)="joinMeet()">Join Meet</button>
            </div>
          </div>
        </div>
      </div>
    </ng-container>

    <ng-container *ngIf="meetType === 'new_meet_successful_form'">
      <div class="flex justify-center w-100">
        <div class="card bg-base-100 w-96 shadow-xl">
          <figure class="px-5 pt-10">
            <svg xmlns="http://www.w3.org/2000/svg" width="175" height="175"
              style="width:175px;height:175px;transform:translate3d(0,0,0);content-visibility:visible"
              viewBox="0 0 430 430">
              <defs>
                <clipPath id="a">
                  <path d="M0 0h430v430H0z" />
                </clipPath>
                <clipPath id="d">
                  <path d="M0 0h430v430H0z" />
                </clipPath>
                <clipPath id="c">
                  <path d="M0 0h430v430H0z" />
                </clipPath>
                <clipPath id="b">
                  <path d="M0 0h430v430H0z" />
                </clipPath>
              </defs>
              <g clip-path="url(#a)">
                <g clip-path="url(#b)" style="display:none">
                  <path class="primary" />
                  <path class="primary" style="mix-blend-mode:multiply" />
                </g>
                <g fill="#2FE848" clip-path="url(#c)" style="display:block">
                  <g style="display:none">
                    <path
                      d="M346.931 67.121a3 3 0 0 0-4.242 0L174.957 234.852l-82.731-82.731a3 3 0 0 0-4.243 0l-55.862 55.861a3 3 0 0 0 0 4.243l140.715 140.714a3 3 0 0 0 4.242 0l225.715-225.714a3 3 0 0 0 0-4.243z"
                      class="primary" />
                    <path fill-opacity=".5"
                      d="m-42.508 24.822.043-.043v119.009a3 3 0 0 1-2.164-.879L-185.344 2.195a3 3 0 0 1 0-4.243l55.862-55.861a3 3 0 0 1 4.242-.001z"
                      class="primary" style="mix-blend-mode:multiply" transform="translate(217.457 210.03)" />
                  </g>
                  <g style="display:block">
                    <path
                      d="M346.931 67.121a3 3 0 0 0-4.242 0L174.957 234.852l-82.731-82.731a3 3 0 0 0-4.243 0l-55.862 55.861a3 3 0 0 0 0 4.243l140.715 140.714a3 3 0 0 0 4.242 0l225.715-225.714a3 3 0 0 0 0-4.243z"
                      class="primary" />
                    <path fill-opacity=".5"
                      d="m-42.508 24.822.043-.043v119.009a3 3 0 0 1-2.164-.879L-185.344 2.195a3 3 0 0 1 0-4.243l55.862-55.861a3 3 0 0 1 4.242-.001z"
                      class="primary" style="mix-blend-mode:multiply" transform="translate(217.457 210.03)" />
                  </g>
                </g>
                <g clip-path="url(#d)" style="display:none">
                  <path class="primary" />
                  <path class="primary" style="mix-blend-mode:multiply" />
                </g>
              </g>
            </svg>
          </figure>
          <div class="card-body items-center text-center">
            <h2 class="card-title">Meeting has been created succesfully.</h2>
            <p>Now, you can share meet details with your friends.</p>
            <div class="card-actions">
              <button class="btn btn-ghost"><i class="bi bi-link-45deg"></i> <strong>Copy Details</strong></button>
            </div>
            <div class="card-actions flex flex-row">
              <button class="btn btn-success text-white" (click)="navigate_MeetingScreen()"><strong>Join
                  Meet</strong></button>
              <button class="btn btn-primary" (click)="reset()"><strong>Back</strong></button>
            </div>
          </div>
        </div>
      </div>
    </ng-container>

  </div>
</div>
